import ClerkSidebar from "../../components/ClerkSidebar";
import Header from "../../components/Header";
import SearchBar from "../../components/AdminCustomersSearchBar";
import ClerkSearchBookingTable from "../../components/ClerkSearchBookingTable";
import React from "react";

export default function ClerkFeedback(){
    return (
        <div className="h-screen flex font-[Poppins]">
            <ClerkSidebar />
            <div className="flex-1 flex flex-col">
                <Header title="Feedback" />
                <main className="inner-container relative flex-1 p-10 bg-[#D9D9D9]">
                    <div className="bg-white w-[50%] h-full mx-3 my-4 rounded-xl p-6 overflow-auto">
                        <form className="p-8">
                            <label className="block text-black">Client Name</label>
                            <input type="text" className="border-2 border-gray-300 rounded-md h-8 w-full mt-1"/>
                            <label className="block text-black mt-8">Movie</label>
                            <input type="text" className="border-2 border-gray-300 rounded-md h-8 w-full mt-1"/>
                            <label className="block text-black mt-8">Hall</label>
                            <input type="text" className="border-2 border-gray-300 rounded-md h-8 w-full mt-1"/>
                            <label className="block text-black mt-8">Description</label>
                            <input type="text" className="border-2 border-gray-300 rounded-md h-8 w-full mt-1"/>
                                <button type="submit">Submit</button>
                        </form>
                    </div>
                </main>
            </div>
        </div>
    )
}
